INSERT INTO `sequence` VALUES (1,'엉덩이 오프너 요가 시퀀스',1800,8,'엉덩이와 골반의 유연성을 증가시키고 긴장을 완화하는 동작들이 포함된 요가 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+1.jpg'),(2,'더 나은 소화를 위한 워밍업 요가 시퀀스',300,8,'소화를 촉진하고 복부의 긴장을 풀어주는 동작들이 포함된 요가 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+10.jpg'),(3,'체중 감량을 위한 아침 요가 포즈',1200,8,'체중 감량을 돕는 동작으로 아침에 활력을 주고 신진대사를 촉진하는 포즈들로 구성된 요가 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+11.jpg'),(4,'운동선수를 위한 워밍업 요가 시퀀스',1200,8,'운동선수가 부상의 위험을 줄이고 근육을 활성화하는 데 도움을 주는 요가 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+12.jpg'),(5,'야간 요가 시퀀스',1200,8,'하루의 긴장을 풀고 숙면을 돕는 편안한 요가 동작들이 포함된 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+13.jpg'),(6,'수영 선수를 위한 요가 시퀀스',1200,8,'수영 선수의 근력과 유연성을 증진시키고, 수영 동작에 필요한 근육을 강화하는 요가 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+14.jpg'),(7,'태양경배의 아쉬탕가 요가 시퀀스 A',1800,8,'아쉬탕가 요가의 첫 번째 시리즈로, 태양경배를 중심으로 몸을 풀고 에너지를 증진하는 시퀀스입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+17.jpg'),(8,'나디 쇼다나 인터미디에이트 시리즈: 아쉬탕가 요가의 두 번째 시리즈',4500,8,'더 깊은 호흡과 고난이도의 자세로 심화된 체력을 기르는 아쉬탕가 요가의 두 번째 시리즈입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+2.jpg'),(9,'아쉬탕가 어드밴스드 시리즈: 아쉬탕가 요가의 세 번째 시리즈',7200,8,'고난도의 동작들이 포함되어 신체의 유연성, 근력, 집중력을 한층 더 강화하는 아쉬탕가 요가의 세 번째 시리즈입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+3.jpg'),(10,'아쉬탕가 요가: 4번째 시리즈',5400,8,'아쉬탕가 요가의 마지막 시리즈로, 고급 기술과 깊은 집중을 요구하는 자세들이 포함된 고난도의 시리즈입니다.','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+4.jpg'),(11,'등을 위한 요가 시퀀스',300,5,'등이 부족한 사람들을 위한 요가 시퀀스','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+5.jpg'),(12,'차크라 요가 시퀀스: 뿌리부터 정수리까지 차크라 밸런싱',4500,50,'차크라 시퀀스를 온몸으로 즐겨보세요','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+6.jpg'),(13,'스프링 요가 시퀀스: 마니푸라 차크라 요가 시퀀스',3600,25,'아침을 여는 차크라 요가 시퀀스','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+7.jpg'),(14,'비냐사 플로우 시퀀스: 비장과 위를 위한 요가',480,8,NULL,NULL),(15,'사이드 벤딩 요가 포즈와 함께하는 하트 오픈 요가 시퀀스',600,10,NULL,NULL),(16,'테스트를 위한 시퀀스',180,3,'테스트를 위한 시퀀스','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+8.jpg'),(17,'점검을 위한 시퀀스',60,2,'최종 점검을 위한 시퀀스','https://prana-yoplay.s3.ap-northeast-2.amazonaws.com/sequenceImage/Frame+9.jpg');
